import React, { Fragment } from 'react';

import GlobalStyle from './styles/global';

const Title = styled.h1`
  color: #f00;
  font-size: 32px;
`;

const App = () => (
  <Fragment>
    <GlobalStyle />
    <div className="App" />
  </Fragment>
);

export default App;
